import React, { useEffect, useState } from 'react'
import './RowPost.css'
import axios from '../../Axios/Axios'
import { API, imageUrl } from '../../Constants/Constants'
function RowPost() {

const [movie, setMovie] = useState([])

  useEffect(() => {
    axios.get(`discover/tv?api_key=${API}&with_networks=213`).then((response)=>{
      setMovie(response.data.resu)
    })
},[])


  return (
    <div className='row'>
        <h2 className="title">Netflix Originals</h2>
        <div className="posters">
            {movie.map()}
            <img className='poster' src="https://i.pinimg.com/564x/79/46/ee/7946ee22b1e06736b3bf5cff6890a7b7.jpg" alt="poster" />
        </div>
    </div>
  )
}

export default RowPost
